import React from 'react';
import './App.css';
 import NavBar from './NavBar/Navbar';
 import CategoriesDisplay from './Categories/CategoriesDisplay';
function App() {
  return (
    <div className="App">
      <NavBar />
      <CategoriesDisplay />
    </div>
  );
}

export default App;
